import React from 'react'

import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import SaveIcon from '@material-ui/icons/Save';
const useStyles = makeStyles({
    root: {
        background: 'rgba(0,128,0)',
        border: 0,
        borderRadius: 3,
        boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
        color: 'white',
        '&:hover': {
            backgroundColor: 'rgba(0,128,0,0.8)',
            color: '#fff',
            outline: "blue"
        },
        '&:focus': {
            outline: "none"
        }
    },
});
const Index = (props) => {


    const classes = useStyles();
    return <Button onClick={props.onClick} disableElevation={false} disabled={props.disabled ? "disabled" : ""} variant="contained" color="primary" className={props.className + " " + classes.root}
        startIcon={<SaveIcon />}>{props.text} </Button>
}

export default Index;
